import {Header} from "../components/Header";
import React, {useContext} from "react";
import {ThingHistoricContext} from "../context/ThingHistoricContext";
import { useLocation } from "react-router";
import {useParams} from "react-router-dom";
import {Line} from "react-chartjs-2";

export const ThingHistoricValues = (props) => {
    const {id, thingProperty, timeData} = useContext(ThingHistoricContext);
    const timestampArray = timeData.map(item => item.timestamp);
    const valueData = timeData.map(item => console.log(item.co2));
    console.log(thingProperty)
    const data = {
        labels: timestampArray,
        datasets: [
            {
                label: thingProperty.title,
                fill: false,
                lineTension: 0.1,
                backgroundColor: 'rgba(75, 192, 192, 0.4)',
                borderColor: 'rgba(75, 192, 192,1)',
                borderCapStyle: 'butt',
                borderDash: [],
                borderDashOffset: 0.0,
                borderJoinStyle: 'miter',
                pointBorderColor: 'rgba(75, 192, 192,1)',
                pointBackgroundColor: '#fff',
                pointBorderWidth: 1,
                pointHoverRadius: 5,
                pointHoverBackgroundColor: 'rgba(75, 192, 192,1)',
                pointHoverBorderColor: 'rgba(220, 220, 220, 1)',
                pointHoverBorderWidth: 2,
                pointRadius: 10,
                pointHitRadius: 10,
                data: valueData
            }
        ]
    };
    return (
        <>
            <Header title={id+ 'Historic Values'} key={'title'}></Header>
            <pre>
                {JSON.stringify(timeData)}
                {JSON.stringify(valueData)}
                {JSON.stringify(timestampArray)}
            </pre>
            <Line data={data}></Line>
        </>
    )
}
